import PracticeTable from "../components/Table/Table";

function PracticeScreen() {
  return (
    <div className="practice-screen">
      <PracticeTable />
      <a
        href="https://your-google-form-link"
        target="_blank"
        rel="noopener noreferrer"
        className="contribute-button text-white bg-teal-700 text-gray-800 rounded-full px-4 py-2 fixed bottom-4 right-4 sm:bottom-8 sm:right-8 hover:border-transparent"
      >
        Contribute
      </a>
    </div>
    
  );
}

export default PracticeScreen;
